import React from 'react';
import {Carousel} from "react-bootstrap";

// image
import Car from "../../images/car";

const Banner = () =>(
<Carousel>
  <Carousel.Item>
    <img class="d-block w-100" src={Car} alt="First slide" />
  </Carousel.Item>
  
</Carousel>
);

export default Banner;
